import { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import millify from 'millify';
import HTMLReactParser from 'html-react-parser';
import { Breadcrumb, Col, Row, Table, Skeleton, Card, Statistic } from 'antd';

import { useGetExchangesQuery } from '../services/cryptoExchanges';
import { HeadingTitle } from '../components';

const columns = [
    {
        dataIndex: 'icon',
        responsive: ['md'],
        render: theImageURL => <img src={theImageURL} alt={theImageURL} />,
    },
    {
        title: 'Exchanges',
        dataIndex: 'name',
        sorter: {
            compare: (a, b) => a.name.localeCompare(b.name),
        },
    },
    {
        title: '24h Trade Volume',
        dataIndex: 'volume',
    },
    {
        title: 'Markets',
        dataIndex: 'numberOfMarkets',
        sorter: {
            compare: (a, b) => a.numberOfMarkets - b.numberOfMarkets,
        },
    },
    {
        title: 'Change',
        dataIndex: 'marketShare',
        sorter: {
            compare: (a, b) => a.marketShare - b.marketShare,
        },
        responsive: ['md'],
    },
];

const Exchanges = () => {
    const { data, isFetching } = useGetExchangesQuery();
    const EXCHANGES = data?.data?.exchanges;
    const STATS = data?.data?.stats;
    const [, setExchanges] = useState([]);
    const [, setStats] = useState([]);

    const tableData = EXCHANGES?.map(exchange => ({
        key: exchange.id,
        icon: exchange.iconUrl,
        name: exchange.name,
        volume: millify(exchange.volume, { precision: 4 }),
        numberOfMarkets: exchange.numberOfMarkets,
        marketShare: millify(exchange.marketShare, { precision: 4 }),
        description: exchange.description,
    })) || [];

    useEffect(() => {
        if (EXCHANGES && STATS) {
            setExchanges(EXCHANGES);
            setStats(STATS);
        }
    }, [EXCHANGES, STATS]);

    if (isFetching) return <Skeleton active />;

    if (!data || !EXCHANGES || !STATS) {
        return <div>No data available</div>;
    }

    return (
        <>
            <Row>
                <Col>
                    <HeadingTitle levelNumber={1} title="Exchanges" cssClass="heading" />
                    <Breadcrumb>
                        <Breadcrumb.Item>
                            <Link to="/">Home</Link>
                        </Breadcrumb.Item>
                        <Breadcrumb.Item>Exchanges</Breadcrumb.Item>
                    </Breadcrumb>
                </Col>
                <div style={{ width: '100%', height: '20px' }} />
                <Col span={24}>
                    <HeadingTitle levelNumber={3} title="Exchanges stats" />
                </Col>
                <Col span={12}>
                    <Card>
                        <Statistic
                            title="Total Volume"
                            value={millify(STATS.volume, { precision: 2 })}
                        />
                    </Card>
                </Col>
                <Col span={12}>
                    <Card>
                        <Statistic title="Total Number" value={millify(STATS.total)} />
                    </Card>
                </Col>
                <Table
                    columns={columns}
                    expandable={{
                        expandedRowRender: ({ description }) => {
                            if (description !== null) {
                                return HTMLReactParser(description);
                            }
                        },
                    }}
                    expandRowByClick={true}
                    dataSource={tableData}
                    pagination={{ position: ['bottomLeft'] }}
                    className="exchange-table"
                />
            </Row>
        </>
    );
};

export default Exchanges;
